import React from "react";
import Navbar from "./Navbar";
import "./AdminPanel.css";
import {
  BsFillPeopleFill,
  BsSearch,
  BsFillPersonLinesFill,
} from "react-icons/bs";

class AdminPanel extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  componentDidMount() {}

  render() {
    return (
      <div>
        <Navbar />
        <main>
          <div className="cards">
            <div className="card-single">
              <div>
                <h1>23</h1>
                <span>Users</span>
              </div>
              <div>
                <span className="las la-users"></span>
              </div>
            </div>
            <div className="card-single">
              <div>
                <h1>41</h1>
                <span>Admins</span>
              </div>
              <div>
                <span className="las la-users"></span>
              </div>
            </div>
            <div className="card-single">
              <div>
                <h1>45</h1>
                <span>Users</span>
              </div>
              <div>
                <span className="las la-users"></span>
              </div>
            </div>
            <div className="card-single">
              <div>
                <h1>13</h1>
                <span>Users</span>
              </div>
              <div>
                <span className="las la-users"></span>
              </div>
            </div>
          </div>
        </main>
      </div>
    );
  }
}

export default AdminPanel;
